import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
            <body>
            <img src="https://steamcdn-a.akamaihd.net/steamcommunity/public/images/steamworks_docs/spanish/sits_large_noborder.png"
                 alt="sits_large_noborder.png" title="sits_large_noborder.png">
             </img>
            </body>
      </header>
    </div>
  );
}

export default App;
